export default function Sidebar() {
    return (
        <>
            <ul>
                <li><a>Account</a></li>
                <li><a>World</a></li>
                <li><a>Tech</a></li>
                <li><a>Sports</a></li>
            </ul>
            <style jsx>{`
                ul {
                    list-style-type: none;
                    width: 200px;
                    background-color: #f1f1f1;
                }

                li a {
                    display: block;
                    padding: 8px 16px;
                    color: #000;
                }

                li a:hover {
                    background-color: #555;
                    color: white;
                }
            `}</style>
        </>
    );
}
